# ACM policy to configure OpenShift authentication to use custom
# login.html and providers.html
apiVersion: policy.open-cluster-management.io/v1
kind: Policy
metadata:
  name: custom-login-page
spec:
  disabled: false
  policy-templates:
    - objectDefinition:
        apiVersion: policy.open-cluster-management.io/v1
        kind: ConfigurationPolicy
        metadata:
          name: custom-login-page
        spec:
          remediationAction: enforce
          severity: high
          object-templates:
            - complianceType: mustonlyhave
              objectDefinition:
                apiVersion: v1
                data:
                  login.html: 
                kind: Secret
                metadata:
                  name: login-template
                  namespace: openshift-config
                type: Opaque
            - complianceType: mustonlyhave
              objectDefinition:
                apiVersion: v1
                data:
                  providers.html: 
                kind: Secret
                metadata:
                  name: providers-template
                  namespace: openshift-config
                type: Opaque
            - complianceType: musthave
              objectDefinition:
                apiVersion: config.openshift.io/v1
                kind: OAuth
                metadata:
                  name: cluster
                spec:
                  templates:
                    login:
                      name: login-template
                    providerSelection:
                      name: providers-template
---
apiVersion: policy.open-cluster-management.io/v1
kind: PlacementBinding
metadata:
  name: custom-login-page
placementRef:
  name: custom-login-page
  kind: PlacementRule
  apiGroup: apps.open-cluster-management.io
subjects:
  - name: custom-login-page
    kind: Policy
    apiGroup: policy.open-cluster-management.io
---
apiVersion: apps.open-cluster-management.io/v1
kind: PlacementRule
metadata:
  name: custom-login-page
spec:
  clusterConditions:
    - status: 'True'
      type: ManagedClusterConditionAvailable
